import axios from "axios";

const baseUrl = "http://localhost:3300/api";

export const loginNetworkRequest = (email, password) => {
  return axios.post(`${baseUrl}/users/login`, { email, password });
};
export const teacherNetworkRequest = (token) => {
  token =
    "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYwZmZhN2ViY2VlYmQ0MTU4NjdhYWYzYiIsImlhdCI6MTYyNzM2ODc1Mn0.WFfnIEvkB23hTdyRHTu8N9U9W067J7-a0QCuSi21NDU";
  return axios.get(`${baseUrl}/teacher`, {
    Headers: { Authorization: `Bearer ${token}` },
  });
};
